import React, { useState, useEffect }from "react";
import { useParams} from 'react-router-dom';
import { fetchAllPosts, patchEdit } from "../api";



const EditPost = ({ isLoggedIn, token }) => {
    const { postId } = useParams();
    const [ogTitle, setOgTitle] = useState('')
    const [ogDescription, setOgDescription] = useState('')
    const [ogPrice, setOgPrice] = useState('')
    const [ogLocation, setOgLocation] = useState('[On Request]')
    const [ogWillDeliver, setOgWillDeliver]= useState(false)

    const [title, setTitle] = useState('')
    const [description, setDescription] = useState('')
    const [price, setPrice] = useState('')
    const [location, setLocation] = useState('[On Request]')
    const [willDeliver, setWillDeliver]= useState(false)
    const [postList, setPostList] = useState([])

    let postIdArray = postId.split('');
    postIdArray.shift();
    let colonlessPostId = postIdArray.join('')


    useEffect(() =>  {


        const getPosts = async () => {
            let returnedPosts = await fetchAllPosts(token);
            setPostList(returnedPosts);
        }

        function findPost() {
            postList.map((eachPost) => {
                if (eachPost._id === colonlessPostId) {
                    console.log("POST HEREEE")
                    setOgTitle(eachPost.title);
                    setOgDescription(eachPost.description)
                    setOgPrice(eachPost.price)
                    setOgLocation(eachPost.location)
                    setOgWillDeliver(eachPost.willDeliver)
                }
            })
        }
    getPosts();
    findPost();
    }, [isLoggedIn])

console.log(colonlessPostId)



    const submitEdits = async (evt) => {
        evt.preventDefault();
        //     let postIdArray = postId.split('');
        //     postIdArray.shift()
        //     console.log(title, description, price, location, willDeliver)
        // let colonlessPostId = postIdArray.join('')
        // const result = await patchEdit(colonlessPostId, token, title, description, price, location, willDeliver)
        // return result;
    }



    return (
        <section id='edit-post-container'>

            <h1>Edit Post</h1>          

            <section className="each-post-section">
                 <h1>Original Post</h1>
                 <span className="post-label">Item: </span>
                 <span className="post-title">{ogTitle}</span><br></br>
                 <span className="post-label">Location: </span>
                 <span className="post-location">{ogLocation}</span><br></br>
                 <span className="post-label">Description: </span>
                 <span className="post-description">{ogDescription}</span><br></br>
                 <span className="post-label">Price: </span>
                 <span className="post-price">{ogPrice}</span><br></br>
                 <span className="post-label">Delivery Available: </span>
                 <span className="post-delivery">{ogWillDeliver ? "Yes" : "No"}</span><br></br>
             </section>
                <form
                    id='edit-post-form'
                    onSubmit={submitEdits}
                >
                    <label className='form-label'>Title: {title}</label>
                    <input
                        type='text'
                        // placeholder={title}
                        onChange={(evt) => setTitle(evt.target.value)}
                    >
                    </input>
                    <label className='form-label'>Description: {description}</label>
                    <input
                        type='text'
                        // placeholder={description}
                        onChange={(evt) => setDescription(evt.target.value)}
                    >
                    </input>
                    <label className='form-label'>Price: {price}</label>
                    <input
                        type='text'
                        // placeholder={price ? price : 'not provided'}
                        onChange={(evt) => setPrice(evt.target.value)}
                    >
                    </input>
                    <label className='form-label'>Location: {location}</label>
                    <input
                        type='text'
                        // placeholder={location ? location : 'not provided'}
                        onChange={(evt) => setLocation(evt.target.value)}
                    >
                    </input>
                    <label className='form-label'>Willing to Deliver?</label>
                    <input
                        type='checkbox'
                        id="willdeliverycheckbox"
                        onChange={(evt) => setWillDeliver(!willDeliver)}
                    >
                    </input>
                    <input
                        type="submit"
                        disabled= {isLoggedIn ? false : true}
                        value="Edit Post"
                    >
                    </input>
                </form>

        </section>
    )
}



export default EditPost;
